import React from "react";

export default function ProjectList(props) {
    return (
        <div className="bg-white">
            <div class="mx-auto max-w-7xl px-4 sm:px-6 lg:px-8">

                <CurrentProjects />
                <ProjectArchive />

            </div>
        </div>
    );
}

function CurrentProjects(props) {
    return (
        <div>
            CurrentProjects
        </div>
    );
}

function ProjectArchive(props) {
    return (
        <div>
            ProjectArchive
        </div>
    );
}
